INSERT INTO `destinos` (`iddestino`, `fecha`, `imagen`, `nombre`, `precio`, `descripcion`, `descripcioncorta`, `numplazas`) VALUES
('DES001', '2018-03-15 00:00:00', , 'Fallas de Valencia', 49.99, 'Las Fallas (Falles en valenciano) son unas fiestas que van del 15 al 19 de marzo con una tradición arraigada en la ciudad de Valencia y diferentes poblaciones de la Comunidad Valenciana. Oficialmente empiezan el último domingo de febrero con el acto de la Crida (en valenciano; \'pregón\', en español).\r\n\r\nActualmente, esta festividad se ha convertido en un atractivo turístico muy importante, ya que además de estar catalogadas como fiesta de Interés Turístico Internacional, en noviembre de 2016 la Unesco las inscribió en su Lista Representativa del Patrimonio Cultural Inmaterial de la Humanidad.2? Estas fiestas también son llamadas fiestas josefinas o festes de Sant Josep (en valenciano), ya que se celebran en honor de San José, patrón de los carpinteros, que era un gremio muy extendido en la ciudad cuando empezaron a celebrarse a finales del siglo XIX, y que conservó hasta la actualidad, dada la importancia de la industria del mueble en la región.', 'Fiesta + alcohol + petarditos', 150);
INSERT INTO `destinos` (`iddestino`, `fecha`, `imagen`, `nombre`, `precio`, `descripcion`, `descripcioncorta`, `numplazas`) VALUES
('DES002', '2018-12-10 00:00:00', , 'Viaje al polo', 999.99, 'Peary, Herbert, Uemura y otros míticos exploradores tuvieron que recorrer más de 800 kilómetros de mar helado antes de alcanzar el Polo Norte. Sin embargo, hoy es posible llegar a la cima del mundo en helicóptero.\r\nNuestro punto de partida será la estación temporal rusa \"Barneo\", situada en un témpano a la deriva en pleno Océano Ártico a 89º de latitud Norte. Desde allí, y en un vuelo de tan solo 40 minutos, llegaremos al soñadoPolo Norte geográfico.  Tras pasar un rato en el lugar más remoto de nuestro planeta iniciaremos el regreso.', 'Pingüinos + frio', 20),
('DES003', '2018-02-28 00:00:00', , 'Viaje a Australia', 369.99, 'Australia posee tesoros inolvidables: el desierto con las rocas sagradas de los aborígenes como Uluru, la costa con su inagotable Barrera de Coral, las vibrantes ciudades de Melbourne o Sidney y su insólita fauna.', 'Bichos raros + australianos', 100);

